lineNumber":4430,"originalJapaneseLine":"　昼間っから酒盛りか」","translatedEnglishLine":"Drinking party in the middle of the day?\""},{"lineNumber":4431,"originalJapaneseLine":"「否！　これは……勝負！　なのだ！」","translatedEnglishLine":"\"No! This is... a contest!\""},{"lineNumber":4432,"originalJapaneseLine":"「は？」","translatedEnglishLine":"\"Huh?\""},{"lineNumber":4433,"originalJapaneseLine":"「負けた方が勝った方に謝り、言う事を聞く……と。","translatedEnglishLine":"\"The loser apologizes to the winner and obeys their words...\""},{"lineNumber":4434,"originalJapaneseLine":"　ずっとこうしてきたのよ」","translatedEnglishLine":"We've always done it this way.\""},{"lineNumber":4435,"originalJapaneseLine":"「ずっと？」","translatedEnglishLine":"\"Always?\""},{"lineNumber":4436,"originalJapaneseLine":"「うむ……まあ、三菱とは付き合い古くての」","translatedEnglishLine":"\"Yes... well, I've had a long relationship with Mitsubishi.\""},{"lineNumber":4437,"originalJapaneseLine":"「満鉄ぁ！　次はお前じゃぞー！」","translatedEnglishLine":"\"Mantetsu! You're next!\""},{"lineNumber":4438,"originalJapaneseLine":"「うぷっ、おぬしもう少し","translatedEnglishLine":"\"Ugh, you should drink a bit more slowly...\""},{ "lineNumber":4439, "originalJapaneseLine":"　ゆっくり飲めばいいものを……","translatedEnglishLine":"You could take your time drinking...\""},

